import React, { Component } from 'react'
import ListAltIcon from '@material-ui/icons/ListAlt';
const token=localStorage.getItem("token")

class MyList extends Component {
    constructor(props){
        super(props)  
        this.state={
        products: [],
        itemcount:"",
        display:false
        }
        } 
componentDidMount() {        
    if(token===null)
    {
      
      this.props.history.push({
           pathname:'/signin'
       })
   }
}
 
    render() {
        return (
            <div className="container">
            <div className="row">
            <div className="col-md-2"></div>
            <div className="col-md-8 p-2" style={{marginBottom:"100px",border:"1px solid #84c225"}}>
            <div className="p-2 text-center" style={{background:"#84c225",fontWeight:"bold"}}>
            <img src={require('../files/basket.png').default} height={30} width={30} />
                Review List
            </div>
            <div>
            <table className="table table-bordered table-hover table-xl text-centered">
      <thead>
      <tr>  
        
        <th><ListAltIcon /></th>
        
        
            
        </tr>
        </thead>
        <tbody>
        <td style={{background:"#DCDCDC"}}>NAME</td>
        </tbody>
        </table>

            </div>
            </div>
            <div className="col-md-2"></div>
             </div>              
            </div>
        )
    }
}

export default MyList
